#import "JSBridgeWebsocket.h"
#import "HTTPLogging.h"

static const int httpLogLevel = HTTP_LOG_LEVEL_WARN | HTTP_LOG_FLAG_TRACE;

@implementation JSBridgeWebsocket

- (void) senddata {
    __block int count = 1000;
//    dispatch_queue_t queue = dispatch_queue_create("ehhe", 0);
//    dispatch_async(queue, ^{
    NSNumber *time2 = @([NSDate date].timeIntervalSince1970 * 1000);
    while (count>0) {
        NSData *data = [NSJSONSerialization dataWithJSONObject:@{@"service":@"test",@"action":@"test2",@"data":@{@"time2":time2,@"index":@(count),@"buf":@""}} options:NSJSONWritingSortedKeys error:nil];
            NSString *req = [[NSString alloc] initWithData:data encoding:NSUTF8StringEncoding];
            [self sendMessage:req];
            count --;
        }
//    });
}
- (void)didOpen
{
    HTTPLogTrace();
    
    [super didOpen];
    
//    [self sendMessage:@"Welcome to my WebSocket"];
    [[NSNotificationCenter defaultCenter] addObserver:self selector:@selector(senddata) name:@"senddata" object:nil];
}

- (void)didReceiveMessage:(NSString *)msg
{
    HTTPLogTrace2(@"%@[%p]: didReceiveMessage: %@", THIS_FILE, self, msg);
    
//    [self sendMessage:[NSString stringWithFormat:@"%@", [NSDate date]]];
    
    NSDictionary *data = [NSJSONSerialization JSONObjectWithData:[NSData dataWithBytes:msg.UTF8String length:msg.length] options:NSJSONReadingMutableLeaves error:nil];
    if ([data[@"action"] isEqualToString:@"test"]) {
        double time = [data[@"time"] longLongValue];
        double diff = [NSDate date].timeIntervalSince1970 * 1000 - time;
        NSDictionary *resp = @{@"service":@"test",@"action":@"test",@"data":@{@"time":data[@"time"],@"diff":[NSString stringWithFormat:@"%f",diff],@"time2":@([NSDate date].timeIntervalSince1970 * 1000),@"index":data[@"index"]?:@1}};
        NSString *respstr = [[NSString alloc] initWithData:[NSJSONSerialization dataWithJSONObject:resp options:NSJSONWritingSortedKeys error:nil] encoding:NSUTF8StringEncoding];
        [self sendMessage:respstr];
        
    }else if ([data[@"action"] isEqualToString:@"test2"]) {
        double time = [data[@"time"] longLongValue];
        NSTimeInterval nowtime = [NSDate date].timeIntervalSince1970 * 1000;
        //js- native
        double js = nowtime - time;
        double diff = [data[@"diff"] longLongValue];
        double alltime = nowtime - [data[@"time2"] longLongValue];
        NSLog(@"新的JSB----------");
        NSLog(@"js-native 时长：%f",js);
        NSLog(@"native-js 时长：%f",diff);
        NSLog(@"整个交互 时长：%f",alltime);
    }
    
}

- (void)didClose
{
    HTTPLogTrace();
    
    [super didClose];
}

@end
